import React, {Component} from 'react'
import Login from './Login.js'

class Nav extends Component {
  render(){
    return(
      <div>
        <h1>ThySpace</h1>
        <button onClick={this.props.toggleShowCreate}>Join thine ranks!</button>
        <Login />
      </div>
    )
  }
}

export default Nav
